import React from "react";

class musicplayer extends React {
  constructor(props) {
    super(props);
    this.state = {
      playing: false
    };
  }
}

handlePlayerClick = () => {
  if (!this.state.playing) {
    this.setState({ playing: true });
  } else {
    this.setState({ playing: false });
  }
  render();
  return (
    <div>
      <audio id="player" loop>
        <source src="./sounds/GrandEscape.m4a" />
      </audio>
      <button onClick="togglePlayer()" class="btn">
        <i className="material-icons ">volume_up</i>
      </button>
    </div>
  );
};
